const tasks = [
{ id: 1, img:'./logo.svg'},
{ id: 2, img:'./faty.jpg', completed: true },
{ id: 3, img:'./flr.jpg', completed: false }
];

return (
<div>
<h1>Liste des figures</h1>
<TaskList tasks={tasks} />
</div>
);
}


export default App;

